import React from "react";
import {
    Box,
    Icon,
    Button,
    Fab,
    styled,
    TablePagination,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
} from "@mui/material";
import { SimpleCard } from "app/components";
import { useState, useEffect } from "react";
import { Link, Navigate } from "react-router-dom";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogTitle from "@mui/material/DialogTitle";
import Slide from "@mui/material/Slide";
import { toast } from "react-toastify";
import { getexamList, getquetionList } from "app/apis/apiMethods";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormLabel from "@mui/material/FormLabel";
import Radio from "@mui/material/Radio";

const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

const Container = styled("div")(({ theme }) => ({
    margin: "30px",
    [theme.breakpoints.down("sm")]: { margin: "16px" },
    "& .breadcrumb": {
        marginBottom: "30px",
        [theme.breakpoints.down("sm")]: { marginBottom: "16px" },
    },
}));

const StyledTable = styled(Table)(({ theme }) => ({
    whiteSpace: "pre",
    "& thead": {
        "& tr": { "& th": { paddingLeft: 0, paddingRight: 0 } },
    },
    "& tbody": {
        "& tr": { "& td": { paddingLeft: 0, textTransform: "capitalize" } },
    },
}));

const StyledButton = styled(Button)(({ theme }) => ({
    margin: theme.spacing(1),
}));

export default function QuestionList() {
    const [state, setState] = useState([]);
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(5);
    const [open, setOpen] = React.useState(false);
    const [userID, setUserID] = useState("");

    function handleClickOpen(id) {
        setOpen(true);
        setUserID(id);
    }
    function handleClose() {
        setOpen(false);
    }

    const questionList = async () => {
        const users = await getquetionList();
        console.log('users.data.data', users.data.data);
        setState(users.data.data);
    };
    useEffect(() => {
        questionList();
    }, []);
    return (
        <Container>
            <Box width="100%" overflow="auto">
                <SimpleCard>
                    <StyledTable>
                        <TableHead>
                            <TableRow>
                                <TableCell align="center" >S.No</TableCell>
                                <TableCell align="center">title</TableCell>
                                <TableCell aligen="center">Options</TableCell>
                                <TableCell align="center">Action</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {state && state
                                .map((item, index) => {
                                    console.log('item, index', item, index);
                                    return (
                                        <TableRow key={index}>
                                            <TableCell align="center">{index + 1}</TableCell>
                                            <TableCell align="center">
                                                <StyledButton variant="contained" color="primary" >
                                                    {item.title}
                                                </StyledButton>
                                            </TableCell>
                                            <TableCell align="center"><StyledButton variant="contained" color="primary" >
                                                    {item.options}
                                                </StyledButton></TableCell>
                                            <FormControlLabel value="option1" control={<Radio />} label="option 1" />
                                            <FormControlLabel value="option2" control={<Radio />} label="option 2" />
                                            <FormControlLabel value="option3" control={<Radio />} label="option 3" />
                                            <FormControlLabel
                                                value="disabled"
                                                disabled
                                                control={<Radio />}
                                                label="(Disabled option)"
                                            />
                                            <Fab
                                                color="secondary"
                                                aria-label="Edit"
                                                className="button"
                                            >
                                                <Link >
                                                    <Icon>view_icon</Icon>
                                                </Link>
                                            </Fab>{" "}
                                        </TableRow>
                                    )
                                })}

                            <Dialog
                                open={open}
                                keepMounted
                                onClose={handleClose}
                                TransitionComponent={Transition}
                                aria-labelledby="alert-dialog-slide-title"
                                aria-describedby="alert-dialog-slide-description"
                            >
                            </Dialog>
                        </TableBody>
                    </StyledTable>
                </SimpleCard>
            </Box>
        </Container>
    );
}
